  useEffect(() => 
  {
    const getTransactions = async () =>
    {
      try
      {
         const response = axios.get('http://localhost:3000/transactions')
      console.log(response)
      }
      catch(err)
      {
        console.log()
      }
     
    }
  }, [])

  return (
    <View style={styles.container}>
        <Text>Listagem</Text>
    </View>
  );
}

